import axios from "axios";

const GEMINI_API_URL =
  "https://generativelanguage.googleapis.com/v1beta/models/gemini-2.0-flash:generateContent";

export async function callGeminiAPI(prompt) {
  const apiKey = "AIzaSyB1mo0mYLvRkle-6OCLUFpS0rbaSdIHiHI";

  try {
    const response = await axios.post(
      `${GEMINI_API_URL}?key=${apiKey}`,
      {
        contents: [
          {
            role: "user",
            parts: [{ text: prompt }],
          },
        ],
      },
      {
        headers: {
          "Content-Type": "application/json",
        },
      }
    );

    const raw = response.data.candidates?.[0]?.content?.parts?.[0]?.text || "";

    // üßπ Clean and parse JSON safely
    const cleaned = raw.replace(/```json|```/g, "").trim();

    let parsed = {};
    try {
      parsed = JSON.parse(cleaned);
    } catch (err) {
      console.error("‚ùå JSON Parse Error:", err);
      throw new Error("Failed to parse Gemini JSON response");
    }

    // ‚úÖ Return expected fields
    return {
      summaryPoints: parsed.summaryPoints || [],
      metlifeExperiencePoints: parsed.metlifeExperiencePoints || [],
      adonsExperiencePoints: parsed.adonsExperiencePoints || [],
      technicalSkills: parsed.technicalSkills || {},
      changesSummary: parsed.changesSummary || [],
      coverLetter: parsed.coverLetter || "",
      coldEmail: parsed.coldEmail || "",
    };
  } catch (error) {
    console.error("Gemini API Error:", error.response?.data || error.message);
    alert(
      "Gemini API Error: " +
        JSON.stringify(error.response?.data || error.message)
    );
    return {
      summaryPoints: [],
      metlifeExperiencePoints: [],
      adonsExperiencePoints: [],
      technicalSkills: {},
      changesSummary: [],
      coverLetter: "",
      coldEmail: "",
    };
  }
}
